import DarrowIcon from "../icons/darrow";

function Menu(props) {
  const position = {
    label: "flex gap-2",
    dropdown: "flex flex-col gap-1",
    parent: "flex gap-2 relative",
    child: "absolute w-40 right-0",
  };
  const design = {
    text: "font-light tracking-wide cursor-pointer",
    texthover: "hover:text-gray-500",
    dropdown: "bg-white px-2 pt-5 pb-2 shadow-lg rounded-xl",
  };

  return (
    <div className={position.parent}>
      <div className={position.label}>
        <h2 className={design.text}>{props.text}</h2>
        <DarrowIcon />
      </div>
      <div
        className={`${position.dropdown} ${position.child} ${design.dropdown}`}
      >
        <p className={`${design.text} ${design.texthover}`}>
          {props.subtext[0]}
        </p>
        <p className={`${design.text} ${design.texthover}`}>
          {props.subtext[1]}
        </p>
        <p className={`${design.text} ${design.texthover}`}>
          {props.subtext[2]}
        </p>
      </div>
    </div>
  );
}

export default Menu;
